import React, { useEffect, useContext } from 'react';
import MyContext from './context';

function OpenStreetCam() {
    const { setImageData, imageData } = useContext(MyContext);

    useEffect(() => {
        fetch('https://api.openstreetcam.org/2.0/photo/?lat=50.9413&lng=6.9583&radius=100')
            .then(response => response.json())
            .then(data => {
                if (data && data.length > 0) {
                    setImageData({
                        lat: data[0].lat,
                        lng: data[0].lng,
                        url: data[0].fileurlProc,
                    });
                }
                console.log('Success:', imageData.lat, imageData.lng, imageData.url);
            })
            .catch(error => console.error('Error:', error));
    }, [setImageData]);

    return (
        <div>
            {imageData && <img src={imageData.url} alt="OpenStreetCam" />}
        </div>
    );
}

export default OpenStreetCam;
